import './Expenses.css';
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";

const Expenses = ({items}) => {

    return (
        <div>
            <ExpensesFilter/>
            <Card className={'expenses'}>
                {items.map((item) => (
                    <ExpenseItem
                        key={item.id}
                        date={item.date}
                        title={item.title}
                        amount={item.amount}/>
                ))}
            </Card>
        </div>
    )
};

export default Expenses;
